  id: string;
  title: string;
  description: string;
  cover: string;
  price: number;
};

const LibraryCard = (
  props: any
  // { id, title, description, cover, price }: AppProps,
) => {
  const [expanded, setExpanded] = useState(false);

  const handleExpandClick = () => {
    setExpanded(!expanded);
  };

